window.bookSummaryJSON = "<p><b>This is a SoundCraft Audiobooks production, with the narration enhanced with music and sound effects, giving you an immersive audio experience that puts you right in the center of the story.</b></p> <p>Lewis Carroll's classic tale of nonsense and imagination, <i>Alice's Adventures in Wonderland</i> was an immediate sensation upon its publication in 1865.&nbsp;It tells the tale of Alice, a young girl who tumbles down a rabbit hole into a world filled with talking rabbits, grinning cats, mad hatters and vengeful queens.</p> <p>Long hailed as one of the greatest children's books ever created, <i>Alice</i> has permeated the culture.&nbsp;The subject of dozens of adaptations, retellings, films and stage productions, <i>Alice </i>and the sequel Carroll penned soon thereafter - <i>Through the Looking Glass</i> - are two of the most treasured works of fiction in the English language.</p> <p>This version - produced in its unabridged form - also includes a brief biography of the author.</p>"; 
